import {Validators} from "./library/Validator";

export const userQuestions = (username, password) => {
    return {
        username: {
            value: username,
            key: 'username',
            label: 'What is your Username',
            min: 5,
            required: changeValidator(username),
            type: 'number',
        },
        password: {
            value: password,
            key: 'password',
            label: 'What is your Password',
            min: 5,
            type: 'password',
            required: {
                validator: Validators.required,
                message: 'Password Must Present'
            },
        },
    }
};

const changeValidator = (username) => username ? {
        validator: Validators.email,
        message: 'Please Provide Correct Email'
    } : {
        validator: Validators.required,
        message: 'Please fillout the form'
    };
